import React from 'react'
import Aux from '../../Aux'

const Layout = (props) => {

    return(
        <Aux>
            <div>Toolbar SideDrawer BackDrop</div>
            <main>
                {props.children}
            </main>
        </Aux>
    )
}

export default Layout
